var ClientDateUtils = Class.create();
ClientDateUtils.prototype = Object.extendsObject(global.AbstractAjaxProcessor, {
	getToday: function(){ //선택한 CI를 기초로 하는 2개 필드값을 가져오는 함수
		var todayDate = new GlideDate(); //cmdb_ci에 대한 gr 객체 생성
		return todayDate; // 클라이언트 사이드로 리턴
	},

    type: 'ClientDateUtils'
});
